import React from 'react'
import Filter from './Porfolio'
import Data from './data'
import Buttons from './button'

function App() {

    const allButtons = ('All', new set(Buttons.map((btn) => btn.id)))

    return (
        <div>
            < Buttons btn={allButtons} />
            < Filter />
        </div>
    )
}

export default App
